arguments.schema:
{
  "type": "object",
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Unique identifier of the member in UUID format"
    },
    "name": {
      "type": "string",
      "description": "Name of the member"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Email address of the member"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Age of the member (20-99 years old)"
    },
    "hobbies": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier of the hobby"
          },
          "name": {
            "type": "string",
            "description": "Name of the hobby"
          }
        },
        "required": ["id", "name"],
        "description": "A hobby with unique identifier and name"
      },
      "description": "List of member's hobbies"
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was created"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when the member was last updated"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null",
          "description": "Indicates the member is not deleted"
        },
        {
          "type": "string",
          "format": "date-time",
          "description": "Timestamp when the member was deleted"
        }
      ],
      "description": "Soft deletion timestamp"
    }
  },
  "required": [
    "id",
    "name",
    "email",
    "age",
    "hobbies",
    "created_at",
    "updated_at",
    "deleted_at"
  ],
  "description": "Member information including personal details and hobbies"
}

